pragma solidity ^0.4.18;


contract Predict {

    struct User {
        uint256 userid;
        string name;
        uint256 sex;
        uint256 birthday;
        uint256 luckynumber;
        uint256[] type_love;
        uint256[] type_career;
        uint256[] type_money;
    }

    struct Record {
        uint256 id;
        uint256 score;
        address owner;
    }

    uint256 private userkey = 1;
    uint256 private lovekey = 1;
    uint256 private careerkey = 1;
    uint256 private moneykey = 1;
    uint256 private balance = 0;
    uint256 private count_help = 0;
    uint256 private count_donate = 0;
    uint256 public tron = 1000000;
    //uint256 tron = 1000000000000000000; 
    uint256 private help_fee = 5;
    address private owneraddress;

    mapping (address => User) private users;
    mapping (uint256 => Record) private record_love;
    mapping (uint256 => Record) private record_career;
    mapping (uint256 => Record) private record_money;

    event createUserSuccess(uint256 userid);
    event predictSuccess(uint256 score);
    event ErrorInput(uint256 typeid);
    event DonateSuccess(uint256 money);
    event HelpSuccess(uint256 money);
    event TransferSuccess(uint256 money);

    constructor () public {
        owneraddress = msg.sender;        
    }

    modifier onlyOwner () {
        require(msg.sender == owneraddress);
        _;
    }

    function checkUser() public view returns(bool) {
        User memory user = users[msg.sender];
        if(user.userid > 0){
            return true;
        }
        return false;
    }

    function createUser (string _name,uint256 _sex, uint256 _birthday, uint256 _luckynumber) private {
        uint256 _userid = getUserkey();
        uint256[] memory type_init;
        User memory user = User({userid:_userid, name:_name, sex:_sex, birthday:_birthday, luckynumber:_luckynumber,type_love:type_init, type_career:type_init, type_money:type_init});
        users[msg.sender] = user;
        updateUserkey();
        emit createUserSuccess(_userid);
    }

    function updateTypelove (uint256 _score) private {
        User storage user = users[msg.sender];
        Record memory record = Record({id:recordid,score:_score,owner:msg.sender});
        uint256 recordid = getLovekey();
        record_love[recordid] = record;
        updateLovekey();
        uint256[] storage type_init = user.type_love;
        type_init.push(recordid);
        user.type_love = type_init;
        users[msg.sender] = user;
    }

    function updateTypecareer (uint256 _score) private {
        User storage user = users[msg.sender];
        Record memory record = Record({id:recordid,score:_score,owner:msg.sender});
        uint256 recordid = getCareerkey();
        record_career[recordid] = record;
        updateCareerkey();
        uint256[] storage type_init = user.type_career;
        type_init.push(recordid);
        user.type_career = type_init;
        users[msg.sender] = user;
    }

    function updateTypemoney (uint256 _score) private {
        User storage user = users[msg.sender];
        Record memory record = Record({id:recordid,score:_score,owner:msg.sender});
        uint256 recordid = getMoneykey();
        record_money[recordid] = record;
        updateMoneykey();
        uint256[] storage type_init = user.type_money;
        type_init.push(recordid);
        user.type_money = type_init;
        users[msg.sender] = user;
    }

    function updateType (uint256 _score, uint256 _type) private {
        if(_type == 1) {
            updateTypelove(_score);
        } 
        if (_type == 2) {
            updateTypecareer(_score);
        } 
        if (_type == 3) {
            updateTypemoney(_score);
        } 
    }

    function predictForothers (uint256 _sex, uint256 _birthday, uint256 _luckynumber, uint256 _type) public {
        uint256 score = uint256(sha256(abi.encodePacked(_sex, _birthday, _luckynumber, _type, now, msg.sender))) % 100 + 1;
        emit predictSuccess(score);
    }

    function predict (uint256 _type) public {
        require(checkUser());
        User storage user = users[msg.sender];
        uint256 score = uint256(sha256(abi.encodePacked(user.sex, user.birthday, user.luckynumber, now, msg.sender))) % 100 + 1;
        updateType(score, _type);
        emit predictSuccess(score);
    }

    function predictFirst (string _name, uint256 _sex, uint256 _birthday, uint256 _luckynumber, uint256 _type) public {
        require(!checkUser());
        createUser(_name, _sex, _birthday, _luckynumber);
        uint256 score = uint256(sha256(abi.encodePacked(_sex, _birthday, _luckynumber, now, msg.sender))) % 100 + 1;
        updateType(score,_type);
        emit predictSuccess(score);
    }

    function donate (uint256 _money) public payable {
        require(msg.value >= _money * tron);
        updateDonate();
        updateBalance(msg.value);
        emit DonateSuccess(_money);
    }

    function help () public payable {
        require(msg.value >= help_fee * tron);
        updateHelp();
        updateBalance(msg.value);
        emit HelpSuccess(msg.value / tron);
    }

    function tansferTo (address _target , uint256 _money) public payable onlyOwner {
        _target.transfer(_money * tron);
        balance = balance - _money * tron;
        emit TransferSuccess(_money);
    }

    function getRecord (uint256 _type, uint256 _id) public view returns (uint256, uint256, address) {
        Record memory record;
        if(_type == 1){
            record = record_love[_id];
        } else if (_type == 2) {
            record = record_career[_id];
        } else if (_type == 3) {
            record = record_money[_id];
        } 
        return(record.id, record.score, record.owner);
    }

    function getUser () public view returns(uint256, string, uint256, uint256, uint256, uint256[], uint256[], uint256[]) {
        User memory user = users[msg.sender];
        return(user.userid, user.name, user.sex, user.birthday, user.luckynumber, user.type_love, user.type_career, user.type_money);
    }

    function getUserkey () public view returns(uint256) {
        return userkey;
    }

    function updateUserkey () private {
        userkey++;
    }

    function getLovekey () public view returns(uint256) {
        return lovekey;
    }

    function updateLovekey () private {
        lovekey++;
    }

    function getCareerkey () public view returns(uint256) {
        return careerkey;
    }

    function updateCareerkey () private {
        careerkey++;
    }

    function getMoneykey () public view returns(uint256) {
        return moneykey;
    }

    function updateMoneykey () private {
        moneykey++;
    }

    function getDonate () public view returns(uint256) {
        return count_donate;
    }

    function updateDonate () private {
        count_donate++;
    }

    function getHelp () public view returns(uint256) {
        return count_help;
    }

    function updateHelp () private {
        count_help++;
    }

    function getBalance () public view onlyOwner returns(uint256) {
        return balance;
    }

    function updateBalance (uint256 _money) private {
        balance = balance + _money;
    }
}
